import './ExpenceItem.css'; //* Simply to tell JS we going to use that particular styles with it!

function ExpenceItem(props) {
	return (
		<div className="expense-item">
			<div>
				<div>{months}</div>
				<div>{year}</div>
				<div>{day}</div>
			</div>
			<div className="expense-item__description">
				<h2>{props.title}</h2>
				<div className="expense-item__price">${props.amount.toFixed(3)}</div>
			</div>
		</div>
	);
}

export default ExpenceItem;
